import { Box, IconButton, Typography } from "@mui/material";

const FilterButton = ({ icon, text }) => {
    return (
        <Box display="flex" mx={1}>
            <IconButton>
                {icon}
            </IconButton>
            <Typography variant="button" display="block">
                {text}
            </Typography>
        </Box>
    );
};

export default FilterButton;
